		this.questions = new Object();
		this.allSurveys;				// Simple list of surveys
		this.allRegions;
		this.views = [];			// Simple list of views
		this.maps = {};				// map panels indexed by the panel id
		this.changed = false;
		this.SURVEY_KEY_PREFIX = "surveys";
		this.TASK_KEY = "tasks";
